import React from 'react'; 
import outputscreenrow from './outputscreenrow'; 

const outputscreen = (props) => { 
return ( 
	<div className="screen"> 
    <outputscreenrow /> 
    <outputscreenrow /> 
	</div> 
) 
} 

export default outputscreen;
